import throughput from '../../images/throughput.svg'
import network from '../../images/netork.svg'
import cloud from '../../images/cloud-monitoring.svg'


const monitoringData = [
    {img: throughput, text: "Prevent resource bottlenecks by collect application metrics with APM monitoring. Understand how your application is performing and work to make a more efficient and stable application.", title:"APM"},

    {img: network, text: "ScaleHaus not only helps you monitor your applications, but we will make sure you monitoring your entire newtork efficiently, on-prem or cloud!", title: "Network"},

    {img: cloud, text: "We take compliance and data governance very seriously. We will make sure that NDA's are signed, as well as ownership and viewing of data remains with your organization.", title: "Cloud"}

]

export default monitoringData;
